import React from "react";
//This should never change therefore it's constant

//using styled components (a great react ext)
const ErrorMessage = styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: white;
`;

const NotFound = () => {
  return <ErrorMessage>Error: Page Not Found!</ErrorMessage>;
};

export default NotFound;
